 Name: OnOpen
 DataType: method
 RandomSeed: 34
 Value: |+1
  for var n := 1 to Translations.yDim 
  	var Dialog_elem:string := Translations[0,n]
  	Dialog.setCaption(Dialog_elem,rootfolder.Localization.getText(Translations[1,n]))
  next
  
  var str:string := rootfolder.Localization.getText(80) -- "Energy"
  refEnergy.name := str
  refEnergy := str
  
  if @.~ = rootfolder 
   	@.Dialog.label := rootfolder.Localization.getText(19)
  else
  	@.Dialog.label := rootfolder.Localization.getMessage(20, @.~.name,"","")
  end
  objects[1,0] := rootfolder.Localization.getText(8) -- "Objects"
  Plotter.title := rootfolder.Localization.getText(31) -- Power Input
   
  UsageProfile.label := rootfolder.Localization.getText(32) -- Usage Profiles
  UsageProfile.title := rootfolder.Localization.getText(33) -- Energy consumption of selected resources
   
  for var j := 1 to 10 
  	EnergyConsumers[j-1,0] := rootfolder.Localization.getText(j + 40)
  next
  ConsumersSelection[1,0] :=  rootfolder.Localization.getText(41) -- Energy Consumers
    
  var tab:table := UsageProfile.UtilizationTable
  for var j := 1 to 6 
  	tab[0,j] := rootfolder.Localization.getText(j + 45)
  next
  var b:boolean := Dialog.getCheckBox("showDisplayPanel_CB")
  DisplayPanel.active := b
  if refEnergy._3D.Exists
  	if b 
  		refEnergy._3D.inheritAttribute("VisibleGraphicGroups")
  	else
  		refEnergy._3D.VisibleGraphicGroups := makeArray() -- VisibleGraphics
  	end
  end
  
  
  Dialog.open
